import Navbar from "./navbar";

const Header = () => {
  return(
    <div className="Header">
         <span>
         <h1>moviematch</h1>
         </span>
         <span>
         <img src={require("../images/Heart1.png")}/>
         </span>
         <Navbar/>
    </div>
  )
}
export default Header;
